import React from "react";

//Material-ui stuff
import Grid from "@material-ui/core/Grid";


export const MiddleOfPage = () => {
  return (
    <Grid  container>
      <Grid className="border" item xs={6}>Hello</Grid>
      <Grid className="border" item xs={6}>Hello from Right</Grid>
    </Grid>
  )
};
